import React from 'react';
import logo from './logo.svg';
import './App.css';

const Header = (props) => {
  console.log(props)
  return (
      <header>
          <h1>{props.title}</h1>
          <h2>{props.subtitle}</h2>
      </header>
  );
}

const App = () => {
  return (
    <div className='scoreboard'>
        <Header title="Call Routing" subtitle="Text" />

        {prop.initPlayers.map(e => 
            <Player key={e.id.toString()} name={e.name} />    
        )}

    </div>
  );
}

export default App;
